import { useEffect } from 'react';

import Header from './Components/Header/Header';
import MenuContainer from './Components/MenuContainer/MenuContainer';
import BannerName from './Components/BannerName/BannerName';

import {
  AccountBalanceWalletRounded,
  Chat,
  Favorite,
  HomeRounded,
  Settings,
  SummarizeRounded
} from '@mui/icons-material';

import deliveryImg from './assets/delivery.png';

import './Styles/App.css';

function App() {
  useEffect(() => {
    // Obter elemento da tag li que está dentro de menu
    const menuLi = document.querySelectorAll("#menu li")

    function setMenuActive() {
      menuLi.forEach((n) => n.classList.remove("active"));
      this.classList.add("active");
    }

    // Para cada elemento do menu de loop
    menuLi.forEach(n => n.addEventListener('click', setMenuActive))
  }, [])

  return (
    <div className="App">
      {/* Header Section */}
      <Header />
      {/* Main Container */}
      <main>
        <div className="mainContainer">
          {/* Banner */}
          <div className="banner">
            <BannerName name={"Vetri"} discount={"20"} link={"#"} />
            <img className="deliveryPic" src={deliveryImg} alt="Delivery" />
          </div>
        </div>
        <div className="rightMenu"></div>
      </main>
      {/* Bottom Menu */}
      <div className="bottomMenu">
        <ul id="menu">
          {/* prettier-ignore */}
          <MenuContainer link={"#"} icon={<HomeRounded />} />
          {/* prettier-ignore */}
          <MenuContainer link={"#"} icon={<Chat />} />
          {/* prettier-ignore */}
          <MenuContainer link={"#"} icon={<AccountBalanceWalletRounded />} />
          {/* prettier-ignore */}
          <MenuContainer link={"#"} icon={<Favorite />} />
          {/* prettier-ignore */}
          <MenuContainer link={"#"} icon={<SummarizeRounded />} />
          {/* prettier-ignore */}
          <MenuContainer link={"#"} icon={<Settings />} />

          <div className="indicator"></div>
        </ul>
      </div>
    </div>
  );
}

export default App;
